generated.css:
*{
    padding: 0;
    margin: 0;
}
@font-face{
    font-family: 'rancho';
    src: url(5c4d38282d732e486b39f0a415af5813.woff) format('woff'),
         url(620c345a0fff541a1e8bb24e2dabeee2.woff2) format('woff');
}

html{
    background: #fff;
    font-family: 'rancho', fantasy, 'Comic Sans Ms', 'Lucida Sans Unicode', 'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', Geneva, Verdana, sans-serif;
}
.butterfly {
    position: fixed;
    z-index: -1
}
.butterfly span {
    display: inline-block;
    background: no-repeat center center/contain
}
.butterfly img {
    width: 100%
}
.butterfly.left span {
    -moz-transform: scale(-1, 1);
    -ms-transform: scale(-1, 1);
    -webkit-transform: scale(-1, 1);
    transform: scale(-1, 1)
}

.butterfly.size1 span {
    /* -webkit-filter: blur(12px);
    filter: blur(12px);
    width: 25px;
    height: 25px */
    -webkit-filter: blur(6px);
    filter: blur(6px);
    width: 12px;
    height: 12px
}
.butterfly.size2 span {
    /* -webkit-filter: blur(6px);
    filter: blur(6px);
    width: 40px;
    height: 40px */
    -webkit-filter: blur(3px);
    filter: blur(3px);
    width: 20px;
    height: 20px
}
.butterfly.size3 span {
    /* -webkit-filter: blur(4px);
    filter: blur(4px);
    width: 55px;
    height: 55px */
    -webkit-filter: blur(2px);
    filter: blur(2px);
    width: 27px;
    height: 27px
}
.butterfly.size4 span {
    /* -webkit-filter: blur(3px);
    filter: blur(3px);
    width: 70px;
    height: 70px */
    -webkit-filter: blur(3px);
    filter: blur(3px);
    width: 35px;
    height: 35px
}

.butterfly.speed1.left div {
    -webkit-animation: moveright 12s linear infinite;
    animation: moveright 12s linear infinite;
}

.butterfly.speed1.left div p {
    -webkit-animation: sway 4s ease infinite;
    animation: sway 4s ease infinite
}

.butterfly.speed1.right div {
    -webkit-animation: moveleft 12s linear infinite;
    animation: moveleft 12s linear infinite;
}

.butterfly.speed1.right div p {
    -webkit-animation: sway 4s ease infinite;
    animation: sway 4s ease infinite;
}



.butterfly.speed2.left div {
    -webkit-animation: moveright 14s linear infinite;
    animation: moveright 14s linear infinite;
}

.butterfly.speed2.left div p {
    -webkit-animation: sway 6s ease infinite;
    animation: sway 6s ease infinite
}

.butterfly.speed2.right div {
    -webkit-animation: moveleft 14s linear infinite;
    animation: moveleft 14s linear infinite;
}

.butterfly.speed2.right div p {
    -webkit-animation: sway 6s ease infinite;
    animation: sway 6s ease infinite
}



.butterfly.speed3.left div {
    -moz-animation: moveright 16s linear;
    -webkit-animation: moveright 16s linear;
    animation: moveright 16s linear
}

.butterfly.speed3.left div p {
    -moz-animation: sway 8s ease infinite;
    -webkit-animation: sway 8s ease infinite;
    animation: sway 8s ease infinite
}

.butterfly.speed3.right div {
    -moz-animation: moveleft 16s linear;
    -webkit-animation: moveleft 16s linear;
    animation: moveleft 16s linear
}

.butterfly.speed3.right div p {
    -moz-animation: sway 8s ease infinite;
    -webkit-animation: sway 8s ease infinite;
    animation: sway 8s ease infinite
}


.butterfly.speed4.left div {
    -webkit-animation: moveright 18s linear;
    animation: moveright 18s linear
}

.butterfly.speed4.left div p {
    -webkit-animation: sway 10s ease infinite;
    animation: sway 10s ease infinite
}

.butterfly.speed4.right div {
    -webkit-animation: moveleft 18s linear;
    animation: moveleft 18s linear
}

.butterfly.speed4.right div p {
    -webkit-animation: sway 10s ease infinite;
    animation: sway 10s ease infinite
}

@-webkit-keyframes moveleft {
    0% {
        -webkit-transform: translate(0, 0);
        transform: translate(0, 0)
    }

    100% {
        -webkit-transform: translate(-1500px, 0);
        transform: translate(-1500px, 0)
    }
}

@keyframes moveleft {
    0% {
        -webkit-transform: translate(0, 0);
        transform: translate(0, 0)
    }

    100% {
        -webkit-transform: translate(-1500px, 0);
        transform: translate(-1500px, 0)
    }
}

@-webkit-keyframes moveright {
    0% {
        -webkit-transform: translate(0, 0);
        transform: translate(0, 0)
    }

    100% {
        -webkit-transform: translate(1500px, 0);
        transform: translate(1500px, 0)
    }
}

@keyframes moveright {
    0% {
        -webkit-transform: translate(0, 0);
        transform: translate(0, 0)
    }

    100% {
        -webkit-transform: translate(1500px, 0);
        transform: translate(1500px, 0)
    }
}

@-webkit-keyframes sway {
    0% {
        -webkit-transform: translate(0, -50px);
        transform: translate(0, -50px)
    }

    50% {
        -webkit-transform: translate(0, 50px);
        transform: translate(0, 50px)
    }

    100% {
        -webkit-transform: translate(0, -50px);
        transform: translate(0, -50px)
    }
}

@keyframes sway {
    0% {
        -webkit-transform: translate(0, -50px);
        transform: translate(0, -50px)
    }

    50% {
        -webkit-transform: translate(0, 50px);
        transform: translate(0, 50px)
    }

    100% {
        -webkit-transform: translate(0, -50px);
        transform: translate(0, -50px)
    }
}
@-webkit-keyframes blurIn{
    from{
        filter: blur(10px);
    }
    to{
        filter: blur(0);
    }
}
@keyframes blurIn{
    from{
        filter: blur(10px);
    }
    to{
        filter: blur(0);
    }
}
.text-words{
    font-size: 40px;
    position: fixed;
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);
    -webkit-animation: blurIn 3s forwards; 
    animation: blurIn 3s forwards;
}
.text-words p{
    width: 200px;
    text-align: center;
}
.mid{
    font-size: 32px;
}
.sm{
    padding-top: 10px;
    font-size: 24px;
}
.white{
    color: #47365a;
    text-shadow: #666 0 0 10px;
}
.red{
    color: red;
}
.fsn{
    background-image: linear-gradient(45deg, red, #111, red);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    animation: bgMove 6s infinite;
}
@keyframes bgMove{
    from{
        background-position-x: 0;
    }
    50%, 100%{
        background-position-x: 200px;
    }
}
.slowAni{
    opacity: 0;
    -webkit-animation: slowAni 6s forwards; 
    animation: slowAni 6s forwards;
}
@keyframes slowAni{
    from{
        opacity: 0;
        filter: blur(10px);
    }
    to{
        opacity: 1;
        filter: blur(0);
    }
}
.fadeIn{
    position: fixed;
    bottom: 5px;
    right: 5px;
    font-size: 24px;
    color: #666;
    -webkit-animation: upIn 6s ease-in 3s forwards;
    animation: upIn 6s ease-in 3s forwards;
    opacity: 0;
}
@keyframes upIn{
    from{
        opacity: 0;
        transform: translateY(200px);
    }
    to{
        opacity: 1;
        transform: translateY(0);
    }
}
@-webkit-keyframes upIn{
    from{
        opacity: 0;
        -webkit-transform: translateY(200px);
        transform: translateY(200px);
    }
    to{
        opacity: 1;
        -webkit-transform: translateY(0);
        transform: translateY(0);
    }
}
